import './App.css';
import HomeTitle from './components/hometitle';
import TextEng from './components/texteng';
import IntroEng from './components/introeng';
import IntroKor from './components/introkor';
import TextKor from './components/textkor';
import MainTab from './components/maintab';

function App() {
  return (
    <div className="App">
      <header className="flex flex-row App-header grid grid-cols-2">
        <div className='basis-4/5'>
          <HomeTitle />

          <section className='flex w-full'>
          <div className='w-2/5'>
          < IntroEng />
          </div>

          <div className='w-2/5'>
          < IntroKor />
          </div>
        </section>

        <section className='flex w-full'>
          <div className='w-2/5'>
          < TextEng />
          </div>

          <div className='w-2/5'>
          < TextKor />
          </div>
        </section>

        </div>

        <div className='col-span-1'>
          <MainTab />
        </div>



      </header>
    </div>
  );
}

export default App;
